import React, { Component } from 'react';
import HeaderAfterLogin from '../../../components/user/HeaderAfterLogin'
import { MDBContainer } from "mdbreact";

class Cart extends Component {
    render() {
        return (
            <div>
                <header>
                    <HeaderAfterLogin />
                </header>
                <main>
                    <MDBContainer>
                        <section class="mt-5 mb-4">
                            <div class="row"></div>
                        </section>
                    </MDBContainer>
                </main>
            </div>
        );
    }
}

export default Cart;
